export default function updateStudentGradeByCity(studentsList, city, grades) {
  return studentsList
    .filter(student => student.location === city)
    .map(student => {
      // Find the grade object that matches the student's id
      const studentGrade = grades.find(grade => grade.studentId === student.id);

      // If the student's grade is found, update the grade; otherwise, set it to 'N/A'
      return {
        ...student,
        grade: studentGrade ? studentGrade.grade : 'N/A',
      };
    });
}

